function findTheArrayConcVal(nums) {
  let result = 0;
  while (nums.length > 0) {
    if (nums.length === 1) {
      result += nums[0];
      nums.pop();
      break;
    }
    result += parseInt(nums[0].toString() + nums[nums.length - 1].toString());
    nums.pop();
    nums.shift();
  }

  return result;
}

