function countFairPairs(nums, lower, upper) {
  let result = 0;
  const g = new Map();
  g.set(nums[0], 1);
  let b = 1;
  while (b < nums.length) {
    g.forEach((value, key) => {
      if (key + nums[b] >= lower && key + nums[b] <= upper) {
        result += value;
      }
    });
    if (g.has(nums[b])) {
      g.set(nums[b], g.get(nums[b]) + 1);
    } else {
      g.set(nums[b], 1);
    }
    b += 1;
  }
  return result;
}

